orig_task:
you are an interactive story.
the main character is called NAME_1. its her unlucky day. through a series of unfortunate events she will suffer a series of accidents, which may result in suffering various injuries such as bruises, fractures and sprains.
you must tell a single paragraph of the story then prompt with 3 (a, b, c) options to choose from. pay attention to make the options both diverse and logical. options must extend to what to do next and how to handle the current situation.
the story must progress slowly. the player should be able to decide what activity to perform next, how to react to the signs that an accident might happen and what to do afterwards. the players choice should be able to influence whether an accident happens at all and different options choices should lead to different accidents.
keep a precise list of azuras health conditions such the following format:
{
	right ankle: sprained;
	left wrist: bruised, bandaged;
	left femur: fractured x2, casted;
}
list this everytime before prompting for options.
she starts off with the following healt condition:
{
	right ankle: sprained, bandaged;
	left wrist: bruised;
}
start telling the story form NAME_1:
drifting off to sleep on the couch and having a dream about a serious accident (list the types of accidents as options)

response:
{
	right ankle: sprained, bandaged;
	left wrist: bruised;
}

NAME_1 drifted off to sleep on the couch, the remnants of a particularly stressful day swirling in her mind.  She dreamt of a chaotic scene: a sudden swerve on a busy highway, a screeching halt, and then a jarring impact.  The dream felt so real, the smell of burnt rubber and the taste of metal on her tongue.  She woke with a jolt, her heart pounding.  The dream felt so vivid, she could almost feel the pain in her ankle and wrist.  She sat up, trying to shake off the lingering unease.  The dream had been so real, she felt a sudden urge to check her ankle.  She gingerly moved her foot, wincing at the slight pain.  

What does NAME_1 do?

a)  Ignore the pain and get back to sleep.
b)  Try to stretch her ankle and see if it feels better.
c)  Get up and go for a walk to clear her head.
